import React, { useState } from "react"
import { useTranslation, withTranslation } from "react-i18next"
import PropTypes from 'prop-types';

import {
    Row,
    Col,
    Button,
    Label,
    Input,
    Modal,
    Card,
    CardBody,
    CardFooter,
    InputGroup,
    CardHeader,
    Table,
} from "reactstrap"

import Switch from "react-switch";
import { AvForm, AvField, AvGroup } from "availity-reactstrap-validation"
import { BackendServices } from "../../../../services";
import { useLocation } from "react-router-dom";
const estiloTotales = { backgroundColor: "lightgrey", color: "black" }
const Offsymbol = () => {
    return (
        <div
            style={{
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                height: "100%",
                fontSize: 12,
                color: "#fff",
                paddingRight: 2,
            }}
        >
            {" "}
            No
        </div>
    );
};

const OnSymbol = () => {
    return (
        <div
            style={{
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                height: "100%",
                fontSize: 12,
                color: "#fff",
                paddingRight: 2,
            }}
        >
            {" "}
            Si
        </div>
    );
};
const posicionBanesco = [
    { id: 1, product: "Cuenta Corriente", vol: "5", participacion: "5", style: {} },
    { id: 2, product: "Cuenta Ahorro", vol: "5", participacion: "5", style: {} },
    { id: 3, product: "DPF", vol: "5", participacion: "5", style: {} },
    { id: 4, product: "Total", vol: "5", participacion: "5", style: {} },
    { id: 5, product: "Linea de Credito", vol: "5", participacion: "5", style: {} },
    { id: 6, product: "Prestamo LP", vol: "5", participacion: "5", style: {} },
    { id: 7, product: "Total Activo", vol: "5", participacion: "5", style: estiloTotales },
];
const productosTransaccionales = [
    { id: 1, product: "Transferencias", vol: "5", participacion: "5", style: {} },
    { id: 2, product: "Facturacion POS/MPos", vol: "5", participacion: "5", style: {} },
    { id: 3, product: "ECommerce", vol: "5", participacion: "5", style: {} },
    { id: 4, product: "TOTAL", vol: "5", participacion: "5", style: estiloTotales },
];
const ModalPrevicualizarIGR = (props) => {
    const { t, i18n } = useTranslation();
    const location = useLocation()
    const [dataLocation, setData2] = useState(location.data);
    console.log(props.dataIGR);
    const [data, setData] = useState(props.dataIGR)

    // Submitimos formulario para busqueda de clientes
    const api = new BackendServices();
    function handleSubmit(event, errors, values) {
        event.preventDefault();
        if (errors.length > 0) {
            return;
        }
        props.onSubmit(values);
    }
    React.useEffect(() => {
        setData(props.dataIGR)
        // Read Api Serv ice ddasata
        initializeData();
    }, [props]);
    function initializeData() {
        api.consultarDatosGeneralesIGR(dataLocation.transactionId).then(resp => {
            if (resp != undefined) {
                data.datosGenerales.transactId = dataLocation.transactionId;
                data.datosGenerales.economicGroup.code = resp.economicGroup.code;
                data.datosGenerales.economicGroup.name = resp.economicGroup.name;
                data.datosGenerales.economicActivity.code = resp.economicActivity.code;
                data.datosGenerales.economicActivity.name = resp.economicActivity.name;
                data.datosGenerales.bank.code = resp.bank.code;
                data.datosGenerales.bank.name = resp.bank.name;
                setData(data);
            }
        }).catch((error) => {

        });
        api.consultarDatosEmpresaIGR(dataLocation.transactionId).then(resp => {
            data.datosEmpresa.country.code = resp.country.code;
            data.datosEmpresa.country.name = resp.country.name;
            data.datosEmpresa.province.name = resp.province.name;
            data.datosEmpresa.province.code = resp.province.code;
            data.datosEmpresa.district.code = resp.district.code;
            data.datosEmpresa.district.name = resp.district.name;
            data.datosEmpresa.township.name = resp.township.name;
            data.datosEmpresa.township.code = resp.township.code;
            data.datosEmpresa.city.code = resp.city.code;
            data.datosEmpresa.city.name = resp.city.name;
            data.datosEmpresa.referencePoint = resp.referencePoint;
            data.datosEmpresa.residency = resp.residency;
            data.datosEmpresa.houseNumber = resp.houseNumber;
            data.datosEmpresa.phoneNumber = resp.phoneNumber;
            data.datosEmpresa.mobileNumber = resp.mobileNumber;
            data.datosEmpresa.workNumber = resp.workNumber;
            data.datosEmpresa.email = resp.email;
            data.datosEmpresa.sector.name = resp.sector.name;
            data.datosEmpresa.sector.code = resp.sector.code;
            data.datosEmpresa.subSector.name = resp.subSector.name;
            data.datosEmpresa.subSector.code = resp.subSector.code;
            data.datosEmpresa.exclusion = resp.exclusion;
            data.datosEmpresa.sustainable = resp.sustainable;
            setData(data);
        }).catch((error) => {
        });
        api.consultarUsuarioProspecto(dataLocation.transactionId).then(resp => {
            if (resp != undefined) {
                data.datosGenerales.codigoTipoPersona = resp.personType
                data.datosGenerales.codigoTipoIdentificacion = resp.identificationType
                data.datosGenerales.numeroCliente = resp.customerNumberT24
                data.datosGenerales.primerNombre = resp.firstName
                data.datosGenerales.segundoNombre = resp.secondName
                data.datosGenerales.primerApellido = resp.firstLastName
                data.datosGenerales.segundoApellido = resp.secondLastName
                data.datosGenerales.numeroIdentificacion = resp.customerDocumentId
                data.datosGenerales.nuevoDato = ""
                setData(data);
            }
        })
        api.consultarListaReciprocidadIGR(dataLocation.transactionId).then(resp => {
            if (resp != undefined) {
                data.dataReciprocidad.dataTableReciprocidad = resp.reciprocities
                setData(data);
            }
        });
        api.consultarActivosFijosIGR(dataLocation.transactionId).then(resp => {
            if (resp != undefined) {
                data.dataFacilidadActivosFijos.dataTableFacilidadActivosFijos = resp.fixedAssets;
                setData(data);
            }
        });
        api.consultarGarantes(dataLocation.transactionId).then(resp => {
            if (resp != undefined) {
                data.dataInformacionGarante.dataTbleInformacionGarantes = resp;
                setData(data);
            }
        });
        api.consultarSegurosEmpresaIGR(dataLocation.transactionId).then(resp => {
            if (resp != undefined) {
                data.dataSegurosActualesEmpresa.dataTableSegurosActualesEmpresa = resp;
                setData(data);
            }
        });
        api.consultarCuentasCobrarIGR(dataLocation.transactionId).then(resp => {
            if (resp != undefined) {
                data.dataCuentasCobrar.dataTableCuentasCobrar = resp;
                setData(data);
            }
        });
        api.consultarCapexIGR(dataLocation.transactionId).then(resp => {
            if (resp != undefined) {
                data.dataCapex.dataTableCapex1 = resp.capex;
                setData(data);
            }
        });
        api.consultarCapexPresupuestoIGR(dataLocation.transactionId).then(resp => {
            if (resp != undefined) {
                data.dataCapex.dataTableCapex2 = resp.capexBudget;
                setData(data);
            }
        });
        api.consultarCapexDetalleProyectoIGR(dataLocation.transactionId).then(resp => {
            if (resp != undefined) {
                data.dataCapex.dataTableCapex3 = resp.capexProjectDetail;
                setData(data);
            }
        });
        /* ---------------------------------------------------------------------------------------------- */
        /*                                 Consulta para el flujo de caja                                 */
        /* ---------------------------------------------------------------------------------------------- */
        api.consultarFlujoCajaDollar(dataLocation.transactionId).then(resp => {
            data.dataFlujoCaja.dataTableFlujoCaja1 = resp.cashFlowDollarDTOList;
            setData(data);
        });
        api.consultarFlujoCajaIngresoFacturacion(dataLocation.transactionId).then(resp => {
            data.dataFlujoCaja.dataTableFlujoCaja2 = resp.cashFlowInvoiceIncome;
            setData(data);
        });
        api.consultarFlujoCajaCobranzas(dataLocation.transactionId).then(resp => {
            data.dataFlujoCaja.dataTableFlujoCaja3 = resp.cashFlowCollection;
            setData(data);
        });
        api.consultarFlujoCajaEgresos(dataLocation.transactionId).then(resp => {
            data.dataFlujoCaja.dataTableFlujoCaja4 = resp.cashFlowOutcome;
            setData(data);
        });
        api.consultarFlujoCajaServicioDeudas(dataLocation.transactionId).then(resp => {
            data.dataFlujoCaja.dataTableFlujoCaja5 = resp.cashFlowDebtServiceDTOList;
            setData(data);
        });
        api.consultarFlujoCajaCargaTrabajo(dataLocation.transactionId).then(resp => {
            data.dataFlujoCaja.dataTableFlujoCaja6 = resp.cashFlowWorkLoad;
            setData(data);
        });
        /* ---------------------------------------------------------------------------------------------- */
        /*                                  Data para matriz competitiva                                  */
        /* ---------------------------------------------------------------------------------------------- */
        api.consultarMatrizOtrosBancosIGR(dataLocation.transactionId).then(resp => {
            if (resp != undefined) {
                data.dataMatrizCompetitiva.dataTableOtrosBancosActivosFijos = resp.competitiveMatrixOtherBanks;
                setData(data);
            }
        });
        api.consultarMatrizNuevosNegociosIGR(dataLocation.transactionId).then(resp => {
            if (resp != undefined) {
                data.dataMatrizCompetitiva.dataTableNuevosNegocios = resp.newBusiness;
                setData(data);
            }
        });
        api.consultarMatrizExpedientesIGR(dataLocation.transactionId).then(resp => {
            if (resp != undefined) {
                data.dataMatrizCompetitiva.dataTableExpedientes = resp.files;
                setData(data);
            }
        });
        api.consultarMatrizRentabilidadIGR(dataLocation.transactionId).then(resp => {
            if (resp != undefined) {
                data.dataMatrizCompetitiva.dataTableRentabilidad = resp.profitability;
                setData(data);
            }
        });
        api.consultarMovimientosCuentasIGR(dataLocation.transactionId).then(resp => {
            if (resp != undefined) {
                data.dataMoviemientosCuentas.dataTableMovimientoCuentas = resp;
                setData(data);
            }
        });
        api.consultarMatrizPosicionBanescoIGR(dataLocation.transactionId).then(resp => {
            if (resp.length > 0) {
                data.dataMatrizCompetitiva.dataTablePosicion = resp;
                setData(data);
            }
        });
        api.consultarMatrizTransaccionBanescoIGR(dataLocation.transactionId).then(resp => {
            if (resp.length > 0) {
                data.dataMatrizCompetitiva.dataTableTransaccion = resp;
                setData(data);
            }
        });

    }

    return (
        <Modal
            size="xl"
            isOpen={props.isOpen}
            toggle={props.toggle}
            centered={true}>
            <div className="modal-header">
                <h5 className="modal-title mt-0">{t("ReinforcedManagementReport")}</h5>
                <button
                    type="button"
                    onClick={props.toggle}
                    data-dismiss="modal"
                    className="close"
                    aria-label="Close">
                    <span aria-hidden="true">&times;</span>
                </button>
            </div>
            <div className="modal-body" style={{ backgroundColor: "#f3f5f7" }}>
                {/* Previsualizacion de datos generales pantalla 1 */}
                <Card>
                    <CardHeader>
                        <h5>{t("General Data")}</h5>
                    </CardHeader>
                    <CardBody>
                        <Row>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("Client Number")}</strong>
                            </Col>
                            <Col xl="4">
                                <Label htmlFor="clientNumber">{data.datosGenerales.numeroCliente == "" || data.datosGenerales.numeroCliente == null ? t("NoData") : data.datosGenerales.numeroCliente}</Label>
                            </Col>
                        </Row>
                        <Row>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("FirstName")}</strong>
                            </Col>
                            <Col xl="4">
                                <Label htmlFor="clientNumber">{data.datosGenerales.primerNombre == "" || data.datosGenerales.primerNombre == null ? t("NoData") : data.datosGenerales.primerNombre}</Label>
                            </Col>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("SecondName")}</strong>
                            </Col>
                            <Col xl="4">
                                <Label htmlFor="clientNumber">{data.datosGenerales.segundoNombre == "" || data.datosGenerales.segundoNombre == null ? t("NoData") : data.datosGenerales.segundoNombre}</Label>
                            </Col>
                        </Row>
                        <Row>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("FirstLastName")}</strong>
                            </Col>
                            <Col xl="4">
                                <Label htmlFor="clientNumber">{data.datosGenerales.primerApellido == "" || data.datosGenerales.primerApellido == null ? t("NoData") : data.datosGenerales.primerApellido}</Label>
                            </Col>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("SecondLastName")}</strong>
                            </Col>
                            <Col xl="4">
                                <Label htmlFor="clientNumber">{data.datosGenerales.segundoApellido == "" || data.datosGenerales.segundoApellido == null ? t("NoData") : data.datosGenerales.segundoApellido}</Label>
                            </Col>
                        </Row>
                        <Row>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("ID Type")}</strong>
                            </Col>
                            <Col xl="4">
                                <Label htmlFor="clientNumber">{data.datosGenerales.codigoTipoIdentificacion == "" || data.datosGenerales.codigoTipoIdentificacion == null ? t("NoData") : data.datosGenerales.codigoTipoIdentificacion}</Label>
                            </Col>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("ID Number")}</strong>
                            </Col>
                            <Col xl="4">
                                <Label htmlFor="clientNumber">{data.datosGenerales.numeroIdentificacion == "" || data.datosGenerales.numeroIdentificacion == null ? t("NoData") : data.datosGenerales.numeroIdentificacion}</Label>
                            </Col>
                        </Row>
                        <Row>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("Economic Group")}</strong>
                            </Col>
                            <Col xl="4">
                                <Label htmlFor="clientNumber">{data.datosGenerales.economicGroup?.name == "" || data.datosGenerales.economicGroup?.name == null ? t("NoData") : data.datosGenerales.economicGroup?.name}</Label>
                            </Col>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("Economic Activity")}</strong>
                            </Col>
                            <Col xl="4">
                                <Label htmlFor="clientNumber">{data.datosGenerales.economicActivity?.name == "" || data.datosGenerales.economicActivity?.name == null ? t("NoData") : data.datosGenerales.economicActivity?.name}</Label>
                            </Col>
                        </Row>
                        <Row>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("Banking")}</strong>
                            </Col>
                            <Col xl="4">
                                <Label htmlFor="clientNumber">{data.datosGenerales.bank?.name == "" || data.datosGenerales.bank?.name == null ? t("NoData") : data.datosGenerales.bank?.name}</Label>
                            </Col>
                        </Row>
                    </CardBody>
                </Card>
                {/* Previsualizacion de datos generales de la empresa pantalla 2 */}
                <Card>
                    <CardHeader>
                        <h5>{t("General of the Company")}</h5>
                    </CardHeader>
                    <CardBody>
                        <Row>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("Country")}</strong>
                            </Col>
                            <Col xl="4">
                                <Label htmlFor="clientNumber">{data.datosEmpresa.country.name == "" || data.datosEmpresa.country.name == null ? t("NoData") : data.datosEmpresa.country.name}</Label>
                            </Col>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("Province")}</strong>
                            </Col>
                            <Col xl="4">
                                <Label htmlFor="clientNumber">{data.datosEmpresa.province.name == "" || data.datosEmpresa.province.name == null ? t("NoData") : data.datosEmpresa.province.name}</Label>
                            </Col>
                        </Row>
                        <Row>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("District")}</strong>
                            </Col>
                            <Col xl="4">
                                <Label htmlFor="clientNumber">{data.datosEmpresa.district.name == "" || data.datosEmpresa.district.name == null ? t("NoData") : data.datosEmpresa.district.name}</Label>
                            </Col>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("Township")}</strong>
                            </Col>
                            <Col xl="4">
                                <Label htmlFor="clientNumber">{data.datosEmpresa.township.name == "" || data.datosEmpresa.township.name == null ? t("NoData") : data.datosEmpresa.township.name}</Label>
                            </Col>
                        </Row>
                        <Row>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("City")}</strong>
                            </Col>
                            <Col xl="4">
                                <Label htmlFor="clientNumber">{data.datosEmpresa.city.name == "" || data.datosEmpresa.city.name == null ? t("NoData") : data.datosEmpresa.city.name}</Label>
                            </Col>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("Reference Point")}</strong>
