                                <Label htmlFor="clientNumber">{data.dataRecomendacionesOtros.valueChain == "" || data.dataNegociosObtener.valueChain == null ? t("NoData") : data.dataNegociosObtener.valueChain}</Label>
                            </Col>
                        </Row>
                        <Row>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("Background")}</strong>
                            </Col>
                            <Col xl="10">
                                <Label htmlFor="clientNumber">{data.dataRecomendacionesOtros.background == "" || data.dataNegociosObtener.background == null ? t("NoData") : data.dataNegociosObtener.background}</Label>
                            </Col>
                        </Row>
                        <Row>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("RefinancingLog")}</strong>
                            </Col>
                            <Col xl="10">
                                <Label htmlFor="clientNumber">{data.dataRecomendacionesOtros.refinancingLog == "" || data.dataNegociosObtener.refinancingLog == null ? t("NoData") : data.dataNegociosObtener.refinancingLog}</Label>
                            </Col>
                        </Row>
                    </CardBody>
                </Card>
            </div>
        </Modal>
    );
};

ModalPrevicualizarIGR.propTypes = {
    isOpen: PropTypes.bool,
    toggle: PropTypes.func
};

